import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import {ArticleList,Layout,ArticleDetail} from './Components';


function App() {
  return(<Router>
    <Switch>
      <Layout>
      <Route exact path="/article-1" children={<ArticleDetail />} />
      <Route path="/" children={<ArticleList />} />
      </Layout>
    </Switch>
  </Router>
  )
}

export default App;
